const makeUrl = (url, page) => {
  if (page > 0) {
    return `${url}/page_${page}.json`;
  }
  return `${url}/page_1.json`;
};

const PATH = "/bucketplace-coding-test/cards";

const URL = {
  GET_PHOTO_LIST: (page) => {
    return makeUrl(PATH, page);
  }
};

export default URL;
